import React from 'react'

 function Contacts ({visibleContacts}){
    return(
        <div>
                <ul>
                    {visibleContacts.map(contact=>(
                        <li key={contact.id}>
                            {contact.name} {contact.number}
                        </li>
                    ))}
                </ul>                
            </div>
 )
}

export default Contacts
